import React from 'react'
import { Text, View } from 'react-native'
import OrderTabBar from '../components/OrderTabBar/OrderTabBar'
import tw from "twrnc";
import ListContainer from '../components/list-container/ListContainer';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { NavigationContainer } from '@react-navigation/native';

function PlaceOrderScreen(){
  return(
    <View style={tw`flex-1 justify-center items-center bg-white`}>
      <Text> Place Order Screen</Text>
    </View>
  );
}

const Tab = createBottomTabNavigator();
const Stack = createNativeStackNavigator();


export default function OrderScreenContainer() {
  return (
    <View
    style={tw`w-full h-full`}
    >

    <NavigationContainer
    independent={true}
    >
      <Tab.Navigator
      screenOptions={{
        tabBarActiveTintColor : '#5BFF8A',
        tabBarInactiveTintColor : 'black',
        tabBarShowIcon: false
      }}      
      >
      <Stack.Screen name='PlaceOrder' component={PlaceOrderScreen}/>
      <Stack.Screen name='SubmittedOrders' component={ListContainer}/>
      </Tab.Navigator>
    </NavigationContainer>
      </View>
  )
}
